typedef double (*Integrand2)(double x , double q, double radius, double thickness, double length, double* res1, double* res2, int n, int i);


void integrate2(
Integrand2 f,
double a,
double b,
double q,
double radius,
double thickness,
double length,
double* res1, double* res2){

    // Determine the number of points for the Gauss quadrature
    int expo = (int)(eval_poly(log2m(max(limits[0][0],min(limits[0][1], q))), log2m(max(limits[1][0],min(limits[1][1], radius))), log2m(max(limits[2][0],min(limits[2][1], thickness))), log2m(max(limits[3][0],min(limits[3][1], length)))) + 1);
    int n = (int)(pow(2, max(1, min(15, expo))));

    double *xg, *wg;
    get_gauss_points(n, &xg, &wg);

    // Perform the integration
    *res1 = 0;
    *res2 = 0;

    for (int i = 0; i < n; i++){
        double t1, t2;
        f(a + (b - a) * 0.5 * (xg[i] + 1), q, radius, thickness, length,  &t1, &t2, n, i);
        *res1 += t1 * wg[i];
        *res2 += t2 * wg[i];
    }

    *res1 *= (b - a) * 0.5;
    *res2 *= (b - a) * 0.5;
}